(1, 'OSCA Minalin', 'OSCA LOGO.png', '08:00:00', '18:00:00', 'elitcapstone@gmail.com', '9057327364', 'OSCA Minalin, Pampanga', 'Pampanga', 'Minalin', 'Bulac,Dawe,Lourdes,Maniago,San Francisco I, San Francisco ll,San Isidro,San Nicolas,San Pedro,Sta. Catalina,Sta. Maria,Sta. Rita,Sto. Domingo,Sto. Rosario,Saplad', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d258.1519712628465!2d120.68614953911158!3d14.970469659350696!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3396586b78860b37%3A0x36416761bd45b6b0!2sMinalin%20Municipal%20Hall!5e1!3m2!1sen!2sph!4v1637313080218!5m2!1sen!2sph\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>', 'https://youtu.be/gjUlEcdqEuw', 'https://www.youtube.com/watch?v=XWsholbsRUs', 'https://www.facebook.com/Municipalityofminalin/', '', '', '', ',Monday,Tuesday,Wednesday,Thursday,Friday,Saturday,Sunday', 'What is Social Pension For Indigent Senior Citizens?', 'socpen.jpg', 'Know more about the program...', 'Social  Pension For Indigent Senior Citizens', '<div style=\"text-align: justify;\">Social Pension For Indigent Senior Citizens The Social Pension for Indigent Senior <span style=\"font-size: 1rem;\">Citizens is one of the provisions stated under Section 5 Republic Act 9994 otherwise </span><span style=\"font-size: 1rem;\">known as the Expanded Senior Citizens Act of 2010 Objectives: Social Pension is </span><span style=\"font-size: 1rem;\">additional government assistance of Five Hundred Pesos Only </span><span style=\"font-size: 1rem;\">(P500.00) monthly stipend to augment the daily subsistence and other medical needs </span><span style=\"font-size: 1rem;\">of indigent senior citizens, subject to a review every two years by Congress in </span><span style=\"font-size: 1rem;\">consultation with the DSWD.</span></div><div>Who are eligible?</div><div>As defined in Section 3 of Republic Act <span style=\"font-size: 1rem;\">9994, indigent senior citizens refer to any elderly who is:</span></div><div><span style=\"font-size: 1rem;\">a. Frail, sickly or with </span><span style=\"font-size: 1rem;\">disability</span></div><div><span style=\"font-size: 1rem;\">b. Without pension</span></div><div><span style=\"font-size: 1rem;\">c. No permanent source of income, compensation, or </span><span style=\"font-size: 1rem;\">financial assistance from relatives to support his/her basic needs.</span></div><div><span style=\"font-size: 1rem;\"><br></span></div><div><span style=\"font-size: 1rem;\">For more information:</span></div><p>Senior citizens may inquire at the nearest City/Municipal Social Welfare Office <span style=\"font-size: 1rem;\">(C/MSWDO and Office of the Senior Citizens Affairs (OSCA)) and DSWD Field Office III </span><span style=\"font-size: 1rem;\">at Tel. No.</span><span style=\"font-size: 1rem;\"> (045) 860 - 5629 - 31 or email at </span><a href=\"http://fo3@dswd.gov.ph/\">fo3@dswd.gov.ph</a></p>', 'hero-bg-1.jpg', 'Official website of OSCA Minalin', 'This website is intended for indigent senior citizens', 'The creation of the Office for Senior Citizens Affairs (OSCA) in Minalin paved the way to care for the needs and concerns of people aged from sixty (60) years and above it was established sometime in the year 2010 with the provision of the Republic Act No. 9994. Known as “Expanded Senior Citizen Act of 2010. The need of creating this office was conceived and developed to put in place the provisions of laws about the protection of innate rights of the elderly', 'Be Updated About Our Activities', 'Subscribe Now!', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Extending support on social legislations, programs, and\r\nactivities for the benefit of senior citizens of Minalin.<o:p></o:p></p>', '251445338_608419390582214_5128286674112071463_n.jpg', '<p class=\"MsoNormal\" style=\"text-align: justify;\">The Office for Senior Citizen’ Affairs envisions the senior\r\ncitizens of Minalin Living in a healthy and peaceful environment with full recognition\r\nof their valuable contribution to community building.<o:p></o:p></p>', 'minalin-1.png', 'officers.jpg', 'Monday', 'Friday', 'Sunday,Monday,Tuesday,Wednesday', '00:00:00', '23:59:00', '5999', 'G578s5x7b7u7oi5kyyc7oKudp5a8szrG', '04f5efd64c1cdaed0a6c3dfcea516d34a1b1d592bdaacfcd7516d0a86fa095ee', '', '0000-00-00 00:00:00', '', '|||');
